import { Component } from '@angular/core';

@Component({
  selector: 'app-confirmar-evento',
  templateUrl: './confirmar-evento.component.html',
  styleUrls: ['./confirmar-evento.component.css']
})
export class ConfirmarEventoComponent {

}
<div>
    <h2>Confirmar Tipo de Evento</h2>
    <p>Selecciona el tipo de evento que deseas crear:</p>

    <button class="btn btn-primary mr-2" [routerLink]='["/evento-agregar-individual"]'>Evento Individual</button>
    <button class="btn btn-primary" [routerLink]='["/evento-agregar-equipo"]'>Evento en Equipo</button>
</div>
